import React from 'react';

import {BrowserRouter, Route} from 'react-router-dom';
import App from './App';

function Routes() {
    return (
        <BrowserRouter>
            <Route path="/" exact component={App}></Route>
        </BrowserRouter>
    );
}

export default Routes;
